DELIMITER ;;
CREATE TRIGGER `update_count_copy` BEFORE UPDATE ON `insta_ft_col_requested` FOR EACH ROW BEGIN
		IF NOT (NEW.instagram_account <=> OLD.instagram_account) THEN
			SET NEW.instagram_account_id = '0',
					NEW.break_status = 0,
					NEW.last_access_id = NULL,
					NEW.recent_access_id = NULL,
					NEW.break_access_id = NULL,
					NEW.more_available = 1;      
     END IF;
END
;;
